import React, { useState } from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import MainContent from './components/MainContent';
import Interface1 from './components/Interface1';
import Interface2 from './components/Interface2';
import Interface3 from './components/Interface3';
import Interface4 from './components/Interface4';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';






function App() {
  const [currentPage, setCurrentPage] = useState('Home');


  const handleNavigate = (page) => {
    setCurrentPage(page);
  };

  return (
    <div>
      {currentPage === 'Home' && (
        <>
          <Header />
          <MainContent onNavigate={handleNavigate} />
          <Footer />
        </>
      )}

      {currentPage === 'Interface1' && (
        <Interface1 onNavigate={handleNavigate} />
      )}

      {currentPage === 'Interface2' && (
        <Interface2 onNavigate={handleNavigate} />
      )}
      {currentPage === 'Interface3' && (
        <Interface3 onNavigate={handleNavigate} />
      )}

      {currentPage === 'Interface4' && (
        <Interface4 onNavigate={handleNavigate} />
      )}
    </div>
  );
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Interface1 />} />
        <Route path="/Interface1" element={<Interface1 />} />
        <Route path="/Interface2" element={<Interface2 />} />
      </Routes>
    </Router>
  );
}

export default App;
